import React from 'react';
import HeaderContact from './header_contactus/header_contactus';
import Footer from '../../parts/footer/footer';


class Contact extends React.Component{
  render(){
    return(
      <div>
        <HeaderContact/>
        <Footer/>
      </div>
    )
  }
}
export default Contact
